$memcache = new Memcache;\nif (!$memcache->connect("localhost", 11211)) {\n    die("Could not connect to memcache server");\n}\n\nfunction outData($getList, $memcache)\n{\n    $key = md5($getList);\n    $memVal = $memcache->get($key);\n    \n    if ($memVal === false) {\n        $results = mysql_query($getList) or die(mysql_error());\n\n        $memVal = ''; // Initialize $memVal\n        // Process the results and build $memVal\n        while ($row = mysql_fetch_assoc($results)) {\n            // Append data to $memVal\n            $memVal .= $row['your_column_name']; // Adjust this line based on your actual data processing\n        }\n\n        $memcache->set($key, $memVal, false, 60000);\n    }\n\n    return $memVal;\n}\n\n// Usage\n$outList = outData($getList, $memcache);